import React from 'react';

function Header() {
  const headerStyle = {
    backgroundColor: '#36545d',
    color: 'white',
    padding: '20px',
    textAlign: 'center',
    height: '75px',
  };

  return (
    <header style={headerStyle}>
      <h1>Student Exercise 1</h1>
      <div>[5 minutes]</div>
    </header>
  );
}

export default Header;
